import './../styles/App.css';
import { Header } from './Header';
import { Buscador } from './Buscador'
import { Cards } from './Cards';

function App() {
  return (
    <div className="App">
      <Header />
      <div className='main-content'>
        <Buscador />
        <Cards/>
      </div>
    </div>
  );
}

export default App;
